import { Article } from "./components/Article/Article";
import { Navbar } from "./components/Navbar/Navbar";

import "./styles/App.css";
// Componente em classe é uma classe que herda a classee Component do React, e retorna HTML dentro do método render.

class App extends React.Component {
  // Método responsável por renderizar o conteúdo HTML do nosso componente.
  render() {
    return (
      <>
        <Navbar />

        <section id="articles">
          <Article 
          title="Exemplo 1" 
          provider="NASA" 
          description="Lorem ipsum dolor, sit amet consectetur adipisicing elit. 
                        Delectus, enim! Fugiat voluptatibus velit ipsam ea dolorum 
                        unde debitis nemo placeat necessitatibus, accusamus error 
                        animi sit cmmodi sint non atque autem."/>
          <Article title="Exemplo 2" />
          <Article title="Exemplo 3" />
          <Article title="Exemplo 4" />
        </section>
      </>
    );
  }
}

export default App;
